#!/usr/bin/env python3# Exercise: Presidents# Write a program to:# (1) Load the data from presidents.txt into a dictionary.# (2) Print the years the greatest and least number of presidents were alive.#     (between 1732 and 2016 (inclusive))#     Ex.#       'least = 2015'#       'John Doe'#       'most = 2015'#       'John Doe, Jane Doe, John Adams, and Jane Adams'# Bonus: Confirm there are no ties. If there is a tie print like so:#     Ex.#       'least = 1900, 2013-2015'#       'John Doe (1900)'#       'Jane Doe (2013-2015)'#       'most = 1900-1934, 2013'#       'John Doe, Jane Doe, John Adams, and Jane Adams (1900-1933)'#       'Sally Doe, Billy Doe, Mary Doe, and Cary Doe (1934)'#       'Alice Doe, Bob Doe, Zane Doe, and Yi Do (2013)'############################################################################### Imports# Bodydef get_range(line):	words = line.split(',')	president = words[0]	birth = words[1]	death = words[2]	if death == 'None':		death = '2016'	return president, int(birth), int(death)def create_dict(filename):	d = {}	with open(filename, 'r') as f:		lines = f.readlines()		for line in lines:			line = line.strip()			president, birth, death = get_range(line)			for year in range(birth, death + 1):				if year in d:					d[year].append(president)				else:					d[year] = [president]	return ddef get_list(d):	count = {}	for key, value in d.items():		count[key] = len(value)	lst = sorted(count, key=count.__getitem__, reverse=True)	return lstdef print_lst(d, l):	top_names = ''	top_year = l[0]	bottom_names = ''	bottom_year = l[-1]	for presidents in d[top_year]:		top_names += presidents + ', '	for presidents in d[bottom_year]:		bottom_names += presidents + ', '	print('least = ', bottom_year)	print(bottom_names)	print('most = ', top_year)	print(top_names)# Bonus: Confirm there are no ties. If there is a tie print like so:##############################################################################def main():  # CALL YOUR FUNCTION BELOW    # print(get_range('George Washington,1732,1799'))    # print(create_dict('presidents.txt'))    # create_dict('presidents.txt')    d = create_dict('presidents.txt')    lst = get_list(d)    print_lst(d, lst)if __name__ == '__main__':    main()